import React from 'react';
import MyImage from '../image/BRAD-PITT.jpg';
//import { NavLink } from 'react-router-dom';
import LinkPage from '../components/LinkPage';



function Home() {
    return (
        <div className='home'>

         <LinkPage 
           name="Coding is my passion, Junior MERN stack web developer&nbsp;&nbsp;"
           imgsrc={MyImage}
           visit= '/service' 
           btname='Get Start' />

        </div>
    );

};

export default Home;
